// import './ScoreBoard.css'

const ScoreBoard = ({score_value}) => {
    return (
        <div>
            <span className='score_board x-score'>X: {score_value.xScore}</span>
            <span>O: {score_value.oScore}</span>
        </div>
    )
}

export default ScoreBoard;
